css:
@-moz-document domain("www.soundgym.co"), domain("www.tonegym.co") {
  ::-webkit-scrollbar {
    width: 15px;
  }
  
  ::-webkit-scrollbar-corner {
    background-color: transparent;
  }
  
  ::-webkit-scrollbar-thumb {
    background-color: #555;
  }
  
  ::-webkit-scrollbar-thumb:hover {
    background-color: #666;
  }
  
  body {
    color: #eee;
    background-color: #000;
  }
  
  div[style="text-align: center; margin: unset; background-color: white; padding: 40px 0 20px 0;"] {
    background-color: #000!important;
  }
  
  section#gym {
    background: #000;
  }
  
  div#blog-item section {
    background: #000;
  }
  
  .grid-results .grid-row {
    box-shadow: 0 0 0px #000;
  }
  
  .grid-results .grid-row .grid-arrow {
    color: #eee;
  }
  
  .nav-btn {
    color: #eee;
  }
  
  p[style="color: #777;"] {
    color: #aaa!important;
  }
  
  .message-item[read='1'] {
    background: #333;
  }
  
  .grid-results .grid-row:nth-child(odd) {
    background: #333;
  }
  
  .grid-results .grid-row:nth-child(even) {
    background: #444;
  }
  
  .grid-results .grid-row:hover {
    background: #555;
  }
  
  hr {
    border-top: 1px solid #888;
  }
  
  a:hover, a:focus {
    color: #ed6864;
  }
  
  .progress {
    background-color: #555;
  }
  
  .box {
    background: #222;
  }
  
  .box.box-white {
    background: #222;
  }
  
  #blog-item .box {
    background: #222;
  }
  
  div#multilingual {
    background: #222!important;
  }
  
  div#multilingual a {
    color: #eee!important;
  }
  
  .col-md-6 div[style="padding: 15px; background: #ccc; border-radius: 5px;"] {
    background: #333!important;
  }
  
  .table-striped>tbody>tr:nth-of-type(odd) {
    background-color: #333;
  }
  
  .btn.btn-flat {
    color: #aaa;
    background: #444;
  }
  
  .btn.btn-flat:hover, .btn.btn-flat:focus, .btn.btn-flat.focus {
    color: #eee;
  }
  
  .internal-nav.active a, .internal-nav:hover a {
    color: #eee;
  }
  
  .message-item a {
    color: #eee;
  }
  
  #dashboard .points a {
    color: #eee;
  }
  
  .col-xs-6 p b a[style="color: #333;"] {
    color: #eee!important;
  }
  
  .text-capitalize a[style="color: #333;"] {
    color: #eee!important;
  }
  
  .box div span {
    color: #eee!important;
  }
  
  .store .store-featured {
    background: #444;
    box-shadow: 0 0 0 1px #444;
  }
  
  .store .store-regular .item-img {
    background: #555;
  }
  
  .store .store-regular:hover {
    background: #444;
    box-shadow: 0 0 0 1px #444;
  }
  
  .member-item .name a {
    color: #aaa;
  }
  
  .leaders-item .name a {
    color: #aaa;
  }
  
  .member-item .name a:hover {
    color: #d9534f;
  }
  
  .leaders-item .name a:hover {
    color: #d9534f;
  }
  
  .form-control {
    color: #eee;
    background-color: #555;
    border: 1px solid #666;
  }
  
  a[monitor="social link"] {
    color: #eee!important;
  }
  
  div[member-feed] .box div[style] {
    background: #333!important;
  }
  
  div[bookmark-feed] .box div[style] {
    background: #333!important;
  }
  
  div[bookmark-feed] .box div[style] {
    background: #333!important;
  }
  
  div div[style="margin-bottom: 10px; padding: 10px; box-shadow: 0 0 1px #aaa; background: #fcfcfc;"] {
    background: #333!important;
  }
  
  .whotofollow-box .whotofollow-top {
    background: #333;
  }
  
  .modal-content {
    background-color: #222;
  }
  
  #notifications .item[state=old] {
    background: #333;
  }
  
  #notifications .item[state=old]:hover {
    background: #444;
  }
  
  .modal-header {
    border-bottom: 1px solid #666;
    display: flex;
    align-items: center;
    flex-direction: row-reverse;
    justify-content: space-between;
  }
  
  .select2-container--default .select2-selection--multiple {
    background-color: #555;
    color: #fff;
  }
  
  .select2-container--default .select2-selection--multiple, .select2-container--default .select2-selection--single {
    border: 1px solid #666;
  }
  
  .select2-container--default.select2-container--focus .select2-selection--multiple, .select2-container--default.select2-container--focus .select2-selection--single {
    border: 1px solid #666;
  }
  
  .select2-container--default .select2-selection--multiple .select2-selection__choice {
    background-color: #777;
    border: 1px solid #aaa;
  }
  
  .select2-container--default .select2-selection--multiple .select2-selection__choice__remove {
    color: #ccc;
  }
  
  .select2-container--default .select2-selection--multiple .select2-selection__choice__remove:hover {
    color: #fff;
  }
  
  .select2-dropdown {
    background-color: #444;
    border: 1px solid #666;
  }
  
  #emoji-box {
    background-color: #444;
    border: 1px solid #666;
    border-radius: 4px;
    box-shadow: rgb(40, 40, 40, 0.5) 3px 3px 7px 2px;
  }
  
  #emoji-box #emoji-selector .emoji-goto {
    background: #555;
    color: #bbb;
  }
  
  #emoji-box #emoji-selector .emoji-goto span:hover {
    color: #fff
  }
  
  .modal-invert .modal-content .modal-header {
    border-bottom-color: #666;
  }
  
  .close {
    color: #fff;
  }
  
  .close:hover, .close:focus {
    color: #fff;
  }
  
  .searcher-filters .searcher-filter.searcher-filter-sub {
    color: #888;
  }
  
  #notifications .item {
    border-top: 1px solid #888;
  }
  
  #notifications .item a {
    color: #eee;
  }
  
  #notifications .item .text {
    color: #eee;
  }
  
  .popover {
    background-color: #333;
  }
  
  .box-white div[style="padding: 20px 25px;margin-top: 15px;background: #f5f5f5;border-radius: 5px;"], .box-white div[style="padding: 20px 25px; margin-top: 15px; background: #f5f5f5; border-radius: 5px;"] {
    background: #333!important;
  }
  
  .space .post.post-form {
    background: #222;
  }
  
  .post-form .actions {
    border-top: 1px solid #888;
  }
  
  .space .post {
    background: #222;
  }
  
  .space .comments-panel {
    background: #333;
  }
  
  .space .post .btn-like:hover {
    color: #aaa;
  }
  
  .space .comments-panel .btn-comment-emoji {
    background: #666;
    color: #ccc;
  }
  
  .space .comments-panel .btn-comment-image {
    background: #666;
    color: #ccc;
  }
  
  .space .comments-panel .btn-comment-emoji:hover {
    color: #fff;
  }
  
  .space .comments-panel .btn-comment-image:hover {
    color: #fff;
  }
  
  div#progress-panel {
    background: #333!important;
  }
  
  .payout {
    background: #333!important;
  }
  
  .dropdown-menu {
    background-color: #333;
  }
  
  .dropdown-menu .divider {
    background-color: #888;
  }
  
  .dropdown-menu > li > a {
    color: #aaa;
  }
  
  .dropdown-menu > li > a:hover, .dropdown-menu > li > a:focus {
    color: #eee;
    background-color: #444;
  }
  
  .lister-middots .opt {
    color: #888;
  }
  
  .dark-link {
    color: #aaa;
  }
  
  .dark-link:hover {
    color: #d9534f;
  }
  
  .shop .plan .head.regular {
    background: #444;
  }
  
  .shop .plan .head {
    border-bottom: 1px solid #888;
  }
  
  .nav-btn {
    background: #333;
    border: 1px solid #333;
  }
  
  .nav-btn:hover {
    background: #555;
    border: 1px solid #555;
  }
  
  #navbar #updates-menu .menu-item .dropdown-menu .item {
    border-top: 1px solid #888;
  }
  
  .shop .plan .details {
    background: #222;
  }
  
  #navbar #updates-menu .menu-item .dropdown-menu .item:hover {
    background: #444;
  }
  
  #program .topic .item a:hover {
    background: #444;
  }
  
  .search-item:hover {
    background: #444;
  }
  
  .space .post.post-form div span {
    color: #eee!important;
  }
  
  .space .post.post-form div a span {
    color: #eee!important;
  }
  
  #navbar #updates-menu .menu-item .dropdown-menu .item .text {
    color: #aaa;
  }
  
  .nav-btn p b span {
    color: #eee!important;
  }
  
  #program .topic .item a {
    color: #eee;
  }
  
  .shop .plan .head .plan-name {
    color: #eee;
  }
  
  .check-item {
    background: #333;
  }
  
  select {
    background: #333!important;
  }
  
  a[monitor="promo"] div img {
    border: 8px solid #f00;
  }
}
